import React, { useState } from "react";

function Doctor() {
    const [signIn, toggle] = useState(true);
    const [showPassword, setShowPassword] = useState(false);

    const handleTogglePassword = () => {
        setShowPassword(!showPassword);
    };

    return (
        <div className="bg-white rounded-md shadow-md overflow-hidden w-11/12 sm:w-10/12 md:w-8/12 lg:w-7/12 xl:w-6/12 mx-auto">
            <div className="flex flex-col h-full">
                {/* Sign Up Section */}
                <div className={`transition-all duration-500 flex flex-col justify-center items-center ${signIn ? 'opacity-0 -translate-x-full' : 'opacity-100 translate-x-0'} sm:w-1/2 md:w-0`}>
                    <h1 className="font-bold text-2xl my-4">Registration form Doctor</h1>
                    <input type='text' placeholder='Name' className="bg-gray-200 border border-gray-300 px-4 py-2 mb-4 w-full" />
                    <input type='email' placeholder='Email' className="bg-gray-200 border border-gray-300 px-4 py-2 mb-4 w-full" />
                    <input type='tel' placeholder='Phone Number' className="bg-gray-200 border border-gray-300 px-4 py-2 mb-4 w-full" />
                    <input type='text' placeholder='Location' className="bg-gray-200 border border-gray-300 px-4 py-2 mb-4 w-full" />
                    <input type='text' placeholder='Years of Service' className="bg-gray-200 border border-gray-300 px-4 py-2 mb-4 w-full" />
                    <div className="relative w-full mb-4">
                        <input type={showPassword ? 'text' : 'password'} placeholder='Password' className="bg-gray-200 border border-gray-300 px-4 py-2 w-full" />
                        <button
                            onClick={handleTogglePassword}
                            className="absolute top-1/2 right-4 transform -translate-y-1/2 text-gray-500"
                        >
                            {showPassword ? 'Hide' : 'Show'}
                        </button>
                    </div>
                    <div className="relative w-full mb-4">
                        <input type={showPassword ? 'text' : 'password'} placeholder='Confirm Password' className="bg-gray-200 border border-gray-300 px-4 py-2 w-full" />
                        <button
                            onClick={handleTogglePassword}
                            className="absolute top-1/2 right-4 transform -translate-y-1/2 text-gray-500"
                        >
                            {showPassword ? 'Hide' : 'Show'}
                        </button>
                    </div>
                    <button className="bg-blue-500 text-white font-bold py-2 px-4 rounded-full transition-transform duration-75 ease-in-out hover:scale-95 focus:outline-none focus:ring-2 focus:ring-blue-400">Sign Up</button>
                </div>
                
                {/* Log In Section */}
                <div className={`transition-all duration-500 flex flex-col justify-center items-center ${signIn ? 'opacity-100 translate-x-0' : 'opacity-0 translate-x-full'} sm:w-1/2 md:w-0`}>
                    <h1 className="font-bold text-2xl my-4">Log in</h1>
                    <input type='email' placeholder='Email' className="bg-gray-200 border border-gray-300 px-4 py-2 mb-4 w-full" />
                    <div className="relative w-full mb-4">
                        <input type={showPassword ? 'text' : 'password'} placeholder='Password' className="bg-gray-200 border border-gray-300 px-4 py-2 w-full" />
                        <button
                            onClick={handleTogglePassword}
                            className="absolute top-1/2 right-4 transform -translate-y-1/2 text-gray-500"
                        >
                            {showPassword ? 'Hide' : 'Show'}
                        </button>
                    </div>
                    <a href='#' className="text-gray-600 text-sm mb-4">Forgot your password?</a>
                    <button className="bg-blue-500 text-white font-bold py-2 px-4 rounded-full transition-transform duration-75 ease-in-out hover:scale-95 focus:outline-none focus:ring-2 focus:ring-blue-400">Submit</button>
                </div>
                
                {/* Welcome Back Section */}
                <div className={`transition-all duration-500 flex flex-col justify-center items-center ${signIn ? 'opacity-100 translate-x-0' : 'opacity-0 translate-x-full'}`}>
                    <h1 className="font-bold text-2xl my-4">Welcome Back To SISAC!</h1>
                    <p className="text-gray-600 mb-4">
                        To keep connected with us please login with your personal info
                    </p>
                    <button onClick={() => toggle(true)} className="bg-blue-500 text-white font-bold py-2 px-4 rounded-full transition-transform duration-75 ease-in-out hover:scale-95 focus:outline-none focus:ring-2 focus:ring-blue-400">Sign In</button>
                </div>
                
                {/* Sign Up Section */}
                <div className={`transition-all duration-500 flex flex-col justify-center items-center ${signIn ? 'opacity-0 translate-x-full' : 'opacity-100 translate-x-0'}`}>
                    <h1 className="font-bold text-2xl my-4">Hello, Doctor!</h1>
                    <p className="text-gray-600 mb-4">
                        Enter Your personal details and start journey with us
                    </p>
                    <button onClick={() => toggle(false)} className="bg-blue-500 text-white font-bold py-2 px-4 rounded-full transition-transform duration-75 ease-in-out hover:scale-95 focus:outline-none focus:ring-2 focus:ring-blue-400">Sign Up</button>
                </div>
            </div>
        </div>
    );
}

export default Doctor;
